import { Switch, Route, Redirect } from 'react-router-dom'


function App() {
  return (

    <Switch>
    <Route path="/" exact>
      <Redirect to="/allQuotes"/>
    </Route>

    <Route path="/allQuotes">
      <p>all quotes</p>
    </Route>

    <Route path="/quote/:id">
      <Products />
    </Route>

    <Route path="/addQuote">
      <ProductDetail />
    </Route>
  </Switch>

  );
}

export default App;
